package fr.rginfo.philou.pgo.map.model;

import com.google.protobuf.InvalidProtocolBufferException;
import org.assertj.core.api.Assertions;
import org.junit.Test;
import pogoprotos.networking.responses.GetMapObjectsResponse;

import java.util.Base64;

public class GetMapObjectsTest {

  private String testObject = "";

//      "";
//      "";
//      "";
//      "";

  @Test
  public void shouldDecodeTestObject() throws InvalidProtocolBufferException {
    byte[] decodedBytes = Base64.getDecoder().decode(testObject);
    GetMapObjectsResponse.GetMapObjectResponse data = GetMapObjectsResponse.GetMapObjectResponse.parseFrom(decodedBytes);
    Assertions.assertThat(data.getMapCellsList().size()).isEqualTo(18);
  }
}
